import React, {Component} from 'react';
import s from './Post.module.css';

class Post extends Component {
    render() {
        {let n=0}
        return (
            <div className={s.post}>
                <img src='https://pbs.twimg.com/profile_images/908447270298828800/odnirBg8_400x400.jpg'/>
                {this.props.message}
                <div>

                    <span onClick={()=>{++n}}>Like `${n}` </span>
                </div>
            </div>




        );
    }
}

export default Post
